-- KSRTC Smart Transport Database Backup


CREATE TABLE `active_trips` (
  `id` int NOT NULL AUTO_INCREMENT,
  `trip_assignment_id` int DEFAULT NULL,
  `schedule_id` int NOT NULL,
  `driver_id` int NOT NULL,
  `bus_id` int NOT NULL,
  `status` enum('SCHEDULED','STARTED','COMPLETED','CANCELLED') DEFAULT 'SCHEDULED',
  `actual_start_time` datetime DEFAULT NULL,
  `actual_end_time` datetime DEFAULT NULL,
  `current_lat` decimal(10,8) DEFAULT NULL,
  `current_lng` decimal(11,8) DEFAULT NULL,
  `current_speed_kmph` decimal(5,2) DEFAULT NULL,
  `last_location_update` timestamp NULL DEFAULT NULL,
  `crowd_level` int DEFAULT '0',
  `delay_minutes` int DEFAULT '0',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `schedule_id` (`schedule_id`),
  KEY `idx_driver` (`driver_id`),
  KEY `idx_bus` (`bus_id`),
  KEY `idx_status` (`status`),
  KEY `idx_start_time` (`actual_start_time`),
  KEY `idx_location` (`current_lat`,`current_lng`),
  KEY `idx_assignment` (`trip_assignment_id`),
  CONSTRAINT `active_trips_ibfk_1` FOREIGN KEY (`trip_assignment_id`) REFERENCES `trip_assignments` (`id`) ON DELETE SET NULL,
  CONSTRAINT `active_trips_ibfk_2` FOREIGN KEY (`schedule_id`) REFERENCES `schedules` (`id`) ON DELETE CASCADE,
  CONSTRAINT `active_trips_ibfk_3` FOREIGN KEY (`driver_id`) REFERENCES `users` (`id`),
  CONSTRAINT `active_trips_ibfk_4` FOREIGN KEY (`bus_id`) REFERENCES `buses` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `bus_tracking` (
  `id` int NOT NULL AUTO_INCREMENT,
  `bus_id` int NOT NULL,
  `schedule_id` int NOT NULL,
  `current_latitude` decimal(10,8) DEFAULT NULL,
  `current_longitude` decimal(10,8) DEFAULT NULL,
  `current_location_name` varchar(100) DEFAULT NULL,
  `status` enum('SCHEDULED','ARRIVING','AT_STOP','IN_TRANSIT','COMPLETED','DELAYED') DEFAULT 'SCHEDULED',
  `last_stop_reached` int DEFAULT NULL,
  `last_stop_time` timestamp NULL DEFAULT NULL,
  `estimated_delay_minutes` int DEFAULT '0',
  `current_passengers` int DEFAULT '0',
  `capacity` int DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_tracking` (`bus_id`,`schedule_id`),
  KEY `schedule_id` (`schedule_id`),
  KEY `bus_tracking_idx` (`bus_id`,`schedule_id`),
  CONSTRAINT `bus_tracking_ibfk_1` FOREIGN KEY (`bus_id`) REFERENCES `buses` (`id`) ON DELETE CASCADE,
  CONSTRAINT `bus_tracking_ibfk_2` FOREIGN KEY (`schedule_id`) REFERENCES `schedules` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `buses` (
  `id` int NOT NULL AUTO_INCREMENT,
  `bus_number` varchar(20) NOT NULL,
  `bus_type` enum('NORMAL','EXPRESS','DELUXE','SLEEPER') DEFAULT 'NORMAL',
  `route_id` int DEFAULT NULL,
  `depot_id` int DEFAULT NULL,
  `capacity` int DEFAULT '50',
  `driver_id` int DEFAULT NULL,
  `current_lat` decimal(10,8) DEFAULT NULL,
  `current_lng` decimal(11,8) DEFAULT NULL,
  `status` varchar(50) DEFAULT 'AVAILABLE',
  `crowd_level` int DEFAULT '0',
  `next_stop` varchar(100) DEFAULT NULL,
  `is_active` tinyint(1) DEFAULT '1',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `driver_name` varchar(100) DEFAULT NULL,
  `driver_phone` varchar(20) DEFAULT NULL,
  `number_plate` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `bus_number` (`bus_number`),
  KEY `depot_id` (`depot_id`),
  KEY `driver_id` (`driver_id`),
  KEY `idx_bus_number` (`bus_number`),
  KEY `idx_route_id` (`route_id`),
  KEY `idx_status` (`status`),
  CONSTRAINT `buses_ibfk_1` FOREIGN KEY (`route_id`) REFERENCES `routes` (`id`) ON DELETE SET NULL,
  CONSTRAINT `buses_ibfk_2` FOREIGN KEY (`depot_id`) REFERENCES `depots` (`id`) ON DELETE SET NULL,
  CONSTRAINT `buses_ibfk_3` FOREIGN KEY (`driver_id`) REFERENCES `users` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=20838 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `depots` (
  `id` int NOT NULL AUTO_INCREMENT,
  `depot_name` varchar(100) NOT NULL,
  `location` varchar(255) DEFAULT NULL,
  `latitude` decimal(10,8) DEFAULT NULL,
  `longitude` decimal(11,8) DEFAULT NULL,
  `phone` varchar(20) DEFAULT NULL,
  `is_active` tinyint(1) DEFAULT '1',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=45 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `driver_assignments` (
  `id` int NOT NULL AUTO_INCREMENT,
  `driver_id` int NOT NULL,
  `schedule_id` int NOT NULL,
  `bus_id` int NOT NULL,
  `depot_id` int DEFAULT NULL,
  `assigned_date` date NOT NULL,
  `status` enum('ASSIGNED','IN_PROGRESS','COMPLETED','CANCELLED') DEFAULT 'ASSIGNED',
  `started_at` timestamp NULL DEFAULT NULL,
  `completed_at` timestamp NULL DEFAULT NULL,
  `notes` text,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_assignment` (`driver_id`,`schedule_id`,`assigned_date`),
  KEY `bus_id` (`bus_id`),
  KEY `depot_id` (`depot_id`),
  KEY `idx_driver_date` (`driver_id`,`assigned_date`),
  KEY `idx_schedule_date` (`schedule_id`,`assigned_date`),
  CONSTRAINT `driver_assignments_ibfk_1` FOREIGN KEY (`driver_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `driver_assignments_ibfk_2` FOREIGN KEY (`schedule_id`) REFERENCES `schedules` (`id`) ON DELETE CASCADE,
  CONSTRAINT `driver_assignments_ibfk_3` FOREIGN KEY (`bus_id`) REFERENCES `buses` (`id`) ON DELETE CASCADE,
  CONSTRAINT `driver_assignments_ibfk_4` FOREIGN KEY (`depot_id`) REFERENCES `depots` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=131654 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `feedback` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `bus_id` int DEFAULT NULL,
  `route_id` int DEFAULT NULL,
  `category` varchar(50) DEFAULT NULL,
  `rating` int DEFAULT NULL,
  `comment` text,
  `admin_response` text,
  `status` enum('PENDING','IN_PROGRESS','RESOLVED') DEFAULT 'PENDING',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `bus_id` (`bus_id`),
  KEY `route_id` (`route_id`),
  KEY `idx_user_id` (`user_id`),
  KEY `idx_status` (`status`),
  CONSTRAINT `feedback_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE,
  CONSTRAINT `feedback_ibfk_2` FOREIGN KEY (`bus_id`) REFERENCES `buses` (`id`) ON DELETE SET NULL,
  CONSTRAINT `feedback_ibfk_3` FOREIGN KEY (`route_id`) REFERENCES `routes` (`id`) ON DELETE SET NULL,
  CONSTRAINT `feedback_chk_1` CHECK ((`rating` between 1 and 5))
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `passes` (
  `id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `pass_type` enum('DAILY','WEEKLY','MONTHLY') NOT NULL,
  `origin` varchar(100) NOT NULL,
  `destination` varchar(100) NOT NULL,
  `distance` decimal(10,2) DEFAULT '0.00',
  `fare` decimal(10,2) NOT NULL,
  `amount` decimal(10,2) DEFAULT NULL,
  `purchase_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `start_date` date DEFAULT NULL,
  `end_date` date DEFAULT NULL,
  `valid_from` date NOT NULL,
  `valid_until` date NOT NULL,
  `is_active` tinyint(1) DEFAULT '1',
  `payment_method` varchar(50) DEFAULT NULL,
  `transaction_id` varchar(100) DEFAULT NULL,
  `payment_status` varchar(50) DEFAULT 'pending',
  `document_type` varchar(50) DEFAULT NULL,
  `document_number` varchar(100) DEFAULT NULL,
  `document_last_digits` varchar(4) DEFAULT NULL,
  `is_approved` tinyint DEFAULT '0',
  `co2_saved` decimal(10,2) DEFAULT '0.00',
  PRIMARY KEY (`id`),
  KEY `idx_user_id` (`user_id`),
  KEY `idx_valid_dates` (`valid_from`,`valid_until`),
  KEY `idx_payment_status` (`payment_status`),
  KEY `idx_end_date` (`end_date`),
  CONSTRAINT `passes_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `route_stops` (
  `id` int NOT NULL AUTO_INCREMENT,
  `route_id` varchar(20) NOT NULL,
  `stop_name` varchar(100) NOT NULL,
  `latitude` decimal(10,8) NOT NULL,
  `longitude` decimal(11,8) NOT NULL,
  `stop_order` int NOT NULL,
  `estimated_minutes_from_origin` int DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `idx_route_id` (`route_id`),
  CONSTRAINT `route_stops_ibfk_1` FOREIGN KEY (`route_id`) REFERENCES `routes` (`route_id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=986 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `routes` (
  `id` int NOT NULL AUTO_INCREMENT,
  `route_id` varchar(20) NOT NULL,
  `route_name` varchar(100) NOT NULL,
  `origin` varchar(100) NOT NULL,
  `destination` varchar(100) NOT NULL,
  `distance` decimal(10,2) DEFAULT NULL,
  `estimated_duration` int DEFAULT NULL,
  `is_active` tinyint(1) DEFAULT '1',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `route_id` (`route_id`),
  KEY `idx_route_id` (`route_id`)
) ENGINE=InnoDB AUTO_INCREMENT=258 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `schedule_stops_tracking` (
  `id` int NOT NULL AUTO_INCREMENT,
  `schedule_id` int NOT NULL,
  `stop_order` int NOT NULL,
  `stop_name` varchar(100) DEFAULT NULL,
  `estimated_arrival_time` time DEFAULT NULL,
  `actual_arrival_time` time DEFAULT NULL,
  `passengers_boarded` int DEFAULT '0',
  `passengers_alighted` int DEFAULT '0',
  `dwell_time_seconds` int DEFAULT '0',
  `status` enum('PENDING','ARRIVED','IN_PROGRESS','COMPLETED') DEFAULT 'PENDING',
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_stop` (`schedule_id`,`stop_order`),
  KEY `idx_schedule_stop` (`schedule_id`,`stop_order`),
  CONSTRAINT `schedule_stops_tracking_ibfk_1` FOREIGN KEY (`schedule_id`) REFERENCES `schedules` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `schedules` (
  `id` int NOT NULL AUTO_INCREMENT,
  `route_id` int NOT NULL,
  `bus_id` int DEFAULT NULL,
  `departure_time` time NOT NULL,
  `arrival_time` time DEFAULT NULL,
  `days_of_week` varchar(50) DEFAULT NULL,
  `is_active` tinyint(1) DEFAULT '1',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `driver_id` int DEFAULT NULL,
  `depot_id` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `bus_id` (`bus_id`),
  KEY `idx_route_id` (`route_id`),
  KEY `idx_departure_time` (`departure_time`),
  KEY `fk_schedule_driver_id` (`driver_id`),
  KEY `depot_id` (`depot_id`),
  CONSTRAINT `fk_schedule_driver_id` FOREIGN KEY (`driver_id`) REFERENCES `users` (`id`) ON DELETE SET NULL,
  CONSTRAINT `schedules_ibfk_1` FOREIGN KEY (`route_id`) REFERENCES `routes` (`id`) ON DELETE CASCADE,
  CONSTRAINT `schedules_ibfk_2` FOREIGN KEY (`bus_id`) REFERENCES `buses` (`id`) ON DELETE SET NULL,
  CONSTRAINT `schedules_ibfk_3` FOREIGN KEY (`depot_id`) REFERENCES `depots` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=21591 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `trip_assignments` (
  `id` int NOT NULL AUTO_INCREMENT,
  `schedule_id` int NOT NULL,
  `assigned_date` date NOT NULL,
  `driver_id` int NOT NULL,
  `bus_id` int NOT NULL,
  `depot_id` int NOT NULL,
  `status` enum('ASSIGNED','CANCELLED') DEFAULT 'ASSIGNED',
  `created_by` int DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_assignment` (`schedule_id`,`assigned_date`),
  KEY `created_by` (`created_by`),
  KEY `idx_driver_date` (`driver_id`,`assigned_date`),
  KEY `idx_depot_date` (`depot_id`,`assigned_date`),
  KEY `idx_bus_date` (`bus_id`,`assigned_date`),
  KEY `idx_status` (`status`),
  KEY `idx_schedule` (`schedule_id`),
  CONSTRAINT `trip_assignments_ibfk_1` FOREIGN KEY (`schedule_id`) REFERENCES `schedules` (`id`) ON DELETE CASCADE,
  CONSTRAINT `trip_assignments_ibfk_2` FOREIGN KEY (`driver_id`) REFERENCES `users` (`id`),
  CONSTRAINT `trip_assignments_ibfk_3` FOREIGN KEY (`bus_id`) REFERENCES `buses` (`id`),
  CONSTRAINT `trip_assignments_ibfk_4` FOREIGN KEY (`depot_id`) REFERENCES `depots` (`id`),
  CONSTRAINT `trip_assignments_ibfk_5` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=385 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

CREATE TABLE `users` (
  `id` int NOT NULL AUTO_INCREMENT,
  `username` varchar(50) NOT NULL,
  `email` varchar(100) NOT NULL,
  `password_hash` varchar(255) NOT NULL,
  `full_name` varchar(100) DEFAULT NULL,
  `phone` varchar(20) DEFAULT NULL,
  `role` enum('user','driver','depot_admin','super_admin') DEFAULT 'user',
  `is_active` tinyint(1) DEFAULT '1',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `depot_id` int DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`),
  UNIQUE KEY `email` (`email`),
  KEY `idx_email` (`email`),
  KEY `idx_role` (`role`),
  KEY `depot_id` (`depot_id`),
  CONSTRAINT `users_ibfk_1` FOREIGN KEY (`depot_id`) REFERENCES `depots` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB AUTO_INCREMENT=136 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
